import axios from 'axios';

const instance = axios.create({
    baseURL: 'http://localhost/',
    timeout: 1000,
    headers: {'X-Custom-Header': 'foobar'}
});

export const getProductList = () => {
   axios.get('products').then((res)=> console.log({res}));
}
